  CardText,
  CardBody,
  CardTitle,
  /*CardSubtitle,*/
  Container,
  Row,
  Col
} from 'reactstrap';
import copy from '../copy.json';

function listItems(data){
  return(data.map((d) => <li>{d}</li>));
}

const useStyles = createUseStyles({
  main: {
    paddingTop: 90
  },
  services: {
    textAlign: 'left'
